import React from 'react'
class home extends React.Component{
    render(){
        return(
            <React.Fragment>
            <h1>Hello World</h1>
            <div>
                <h1 onClick="Check">hello Wolrd</h1>
            </div>
            </React.Fragment>
        );       
    }
}
export default home;
